import { actionTypes } from "../actions/loading.action";

const initialState = {
  ITEMS: []
}

export default (state = initialState, action) => {
  switch (action.type) {
    
    case actionTypes.INDEX_ITEMS:
      return action.payload.data;

    default:
      return state;
  }
}
